import React from 'react'
import Avatar from '@mui/material/Avatar';
import Stack from '@mui/material/Stack';
import SejunImage from '../images/avatar.jpg'
import { Typography } from '@mui/material';
import logo from '../images/userlogo.png'
import PersonOutlineIcon from '@mui/icons-material/PersonOutline';
import SearchIcon from '@mui/icons-material/Search';
import UploadIcon from '@mui/icons-material/Upload';
import AddIcon from '@mui/icons-material/Add';
import HomeOutlinedIcon from '@mui/icons-material/HomeOutlined';
import InsertChartOutlinedIcon from '@mui/icons-material/InsertChartOutlined';

const SideBar = () => {
  return (
    <>
    <Stack sx={{padding:"24px"}} spacing={8}>
      <Stack spacing={3}>
        <Stack direction="row" spacing={1}  sx={{
        borderRadius:"5px",
        padding:"8px",
        cursor: "pointer",
        "&:hover": {
          backgroundColor: "#E5E7EB",
        }
      }}  >
          <HomeOutlinedIcon/>
          <Typography sx={{fontSize:"16px",fontFamily:'Inter',fontWeight:"regular",color:"#4B5563"}}>Home</Typography>
        </Stack>
        <Stack direction="row" spacing={1}  sx={{
        borderRadius:"5px",
        padding:"8px",
        cursor: "pointer",
        "&:hover": {
          backgroundColor: "#E5E7EB",
        }
      }}  >
          <PersonOutlineIcon/>
          <Typography sx={{fontSize:"16px",fontFamily:'Inter',fontWeight:"regular",color:"#4B5563"}}>Users</Typography>
        </Stack>
        <Stack direction="row" spacing={1} sx={{
        borderRadius:"5px",
        padding:"8px",
        cursor: "pointer",
        "&:hover": {
          backgroundColor: "#E5E7EB",
        }
      }}  >
          <SearchIcon/>
          <Typography sx={{fontSize:"16px",fontFamily:'Inter',fontWeight:"regular",color:"#4B5563"}}>Search</Typography>
        </Stack>
        <Stack direction="row" spacing={1} sx={{
        borderRadius:"5px",
        padding:"8px",
        cursor: "pointer",
        "&:hover": {
          backgroundColor: "#E5E7EB",
        }
      }}  >
          <AddIcon/>
          <Typography sx={{fontSize:"16px",fontFamily:'Inter',fontWeight:"regular",color:"#4B5563"}}>Add Users</Typography>
        </Stack>
      </Stack>
    </Stack>

    </>
  )
}

export default SideBar
